eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst copyDE = {\n    \"nav\": {\n        \"academy\": \"Akademie\",\n        \"studio\": \"Studio\",\n        \"events\": \"Veranstaltungen\",\n        \"stories\": \"Geschichten\",\n        \"about\": \"\\xfcber\",\n        \"contact\": \"Kontakt\"\n    },\n    \"footer\": {\n        \"privacy\": \"Privatssph\\xe4re\",\n        \"legalNotice\": \"Impressum\"\n    },\n    \"newsletter\": {\n        \"callToAction\": \"Abonnier unseren Newsletter\",\n        \"placeholder\": \"F\\xfcge deine Email Adresse hinzu\",\n        \"submit\": \"Abonnieren\"\n    },\n    \"home\": {\n        \"manifesto\": {\n            \"header\": \"Devhaus Leipzig\",\n            \"subheader\": \"Eine Lernende Gemeinschaft f\\xfcr Programmierer\",\n            \"part1\": \"Das Devhaus Leipzig ist aus dem Bed\\xfcrfnis heraus entstanden, einen Ort zu schaffen, an dem Entwickler:Innen lernen und zu sinnvollen Projekten beitragen k\\xf6nnen. Unser Ziel ist es, die Mitglieder unserer Gemeinschaft dabei zu unterst\\xfctzen, ihre kreativen und beruflichen Ziele zu erreichen.\",\n            \"part2\": \"Angehende Entwickler:Innen k\\xf6nnen an unserer Akademie teilnehmen, um die Grundlagen der Softwareentwicklung zu erlernen. Nach deinem Abschluss schlie\\xdft du dich unserer Gemeinschaft von Bewohnern im Studio an, wo deine pers\\xf6nlichen und beruflichen Projekte die Unterst\\xfctzung finden, die sie brauchen, um erfolgreich zu sein.\"\n        },\n        \"academy\": {\n            \"header\": \"Akademie\",\n            \"subheader\": \"Mache die ersten Schritte auf dem Weg zum Softwaredeveloper \"\n        },\n        \"studio\": {\n            \"header\": \"Studio\",\n            \"subheader\": \"Beteilige dich sich an kreativen Softwareprojekten oder starte dein eigenes\"\n        },\n        \"events\": {\n            \"header\": \"Veranstaltungen\",\n            \"subheader\": \"Vernetze dich mit der Devhaus-Gemeinschaft\"\n        },\n        \"stories\": {\n            \"header\": \"Geschichten\",\n            \"subheader\": \"Bleib auf auf dem Laufenden \\xfcber das Geschehen im Devhaus Leipzig\"\n        },\n        \"about\": {\n            \"header\": \"Wer sind wir?\",\n            \"subheader\": \"\\xdcber uns\"\n        }\n    },\n    \"academy\": {\n        \"block1\": {\n            \"title\": \"Akademie\",\n            \"description\": \"Die Devhaus Akademie ist mehr als nur ein Klassenzimmer; sie ist ein fortlaufendes Unterst\\xfctzungssystem, dessen einziger Zweck es ist, dir zu helfen, beste Programmierer:innen  und Designer:innen zu werden.\",\n            \"picAltText\": \"Absolventen des Code Camps #1\"\n        },\n        \"block2\": {\n            \"header3\": \"Devhaus Akademie\",\n            \"header2\": \"Code & Design Camp\",\n            \"courseLength\": \"23 Wochen\",\n            \"classDays\": \"Mo - Fr\",\n            \"classTimes\": \"9:00 - 17:00\",\n            \"courseLanguage\": \"Englisch\",\n            \"classHeadCount\": \"12 Sch\\xfcler:Innen\",\n            \"classFormat\": \"Hybrid (online oder in-person)\",\n            \"courseDates\": \"Das n\\xe4chste Camp beginnt am # und endet am @\" /* # is the start date, @ is the end date*/ ,\n            \"applicationType\": \"Bewerbungen werden fortlaufend angenommen.\",\n            \"applyLink\": \"Jetzt Bewerben\",\n            \"paragraph1\": \"Unser Code & Design Camp ist ein intensives Vollzeit-Trainingsprogramm, das entwickelt wurde, um Menschen mit unterschiedlichem beruflichem Hintergrund mit den notwendigen F\\xe4higkeiten und dem Verst\\xe4ndnis f\\xfcr die Welt der digitalen Produktentwicklung auszustatten\",\n            \"paragraph2\": \"Zwei Jahre lang unterst\\xfctzten wir 13-w\\xf6chige Camps und stellten fest, dass trotz der Tatsache, dass mehr als 85% unserer Absolventen nach ihrem Abschluss in technischen Berufen arbeiten, viele Jobs f\\xfcr Juniorentwickler tiefere Kenntnisse erfordern und viele Studierende monatelang zus\\xe4tzliches Selbsttraining ben\\xf6tigten, um wettbewerbsf\\xe4hig zu sein.\",\n            \"paragraph3\": \"Unser 23-w\\xf6chiger Kurs ist so konzipiert, dass er allen Teilnehmer:innen den Lehrplan, die Umgebung und die Unterst\\xfctzung bietet, die sie ben\\xf6tigen, um f\\xfcr eine Junior-Frontend-Entwickler-Position vorbereitet zu sein und die Grundlage zu schaffen, um in andere technische Rollen hineinzuwachsen.\",\n            \"keyFeatures\": \"Wesentliche Merkmale\",\n            \"keyFeature1\": \"2 Wochen Agile Workshops und Workshops zur beruflichen Entwicklung\",\n            \"keyFeature2\": \"4 Wochen UI/UX- und Produktdesign-Lehrplan\",\n            \"keyFeature3\": \"4 Wochen Backend- und Einf\\xfchrungslehrplan\",\n            \"keyFeature4\": \"6 Wochen Portfolio-Projektarbeit\",\n            \"keyFeature5\": \"12 Einzelsitzungen zur Unterst\\xfctzung der technischen, beruflichen und pers\\xf6nlichen Entwicklung\",\n            \"keyFeature6\": \"2 Professionell konzipierte Hackathons mit einstellenden Unternehmen\",\n            \"keyFeature7\": \"2 Tage Workshops zur beruflichen Entwicklung mit einstellenden Unternehmen\"\n        },\n        \"block3\": {\n            \"header\": \"Unser Ansatz\",\n            \"sectionHeader1\": \"Ganzheitliche Software-Entwickler\",\n            \"section1\": \"Softwareentwickler:Innen sind keine Code-Monkeys. Wir glauben, dass die besten Entwickler:Innen das Programmieren als ein Werkzeug zur L\\xf6sung von Problemen verstehen, F\\xe4higkeiten entwickeln und Wissen au\\xdferhalb der Programmierung aufbauen, um das Spektrum der Probleme zu erweitern, die sie angehen k\\xf6nnen. Sie verstehen und sch\\xe4tzen alle Aspekte der Erstellung einer Software und sind in der Lage, st\\xe4ndig zu bewerten, wie ihre Arbeit am besten zu dem \\xfcbergreifenden Problem beitr\\xe4gt, das die Software, die sie entwickeln, zu l\\xf6sen versucht.\",\n            \"sectionHeader2\": \"Selbst-bestimmendes Lernsystem\",\n            \"section2\": \"Experten sind erfahrene Lerner. Unser vorrangiges Ziel ist es daher, unseren Sch\\xfclerInnen ein effektives, selbstgesteuertes Lernsystem zu vermitteln, das ihnen f\\xfcr den Rest ihres Lebens von Nutzen sein wird. Durch die Verwendung eines einfachen Tagebuchsystems, das die effektivsten Lernstrategien jeden Tag w\\xe4hrend des Camps f\\xf6rdert, sind wir in der Lage, leistungsstarke Routinen aufzubauen, die auch f\\xfcr das selbstgesteuerte Lernen nach dem Camp geeignet sind.\",\n            \"sectionHeader3\": \"Evidenzbasiertes Unterrichten\",\n            \"section3\": \"Wir st\\xfctzen uns auf Erkenntnisse aus den Lernwissenschaften, um unsere Lehrmethoden zu entwickeln, und kombinieren diese mit unserer Praxis und Intuition, um leistungsstarke und adaptive Lernerfahrungen zu schaffen. Die wichtigsten Erkenntnisse, auf die wir unsere Methodik st\\xfctzen, sind:\",\n            \"section3bullet1\": \"Rosenshine-Prinzipien f\\xfcr effektiven Unterricht anhand von Arbeitsbeispielen mit authentischen Aufgaben und schrittweisem \\xdcbergang zu selbst\\xe4ndigem \\xdcben\",\n            \"section3bullet2\": \"Abrufpraxis, die sowohl Abst\\xe4nde als auch Verschachtelungen nutzt\",\n            \"section3bullet3\": \"Feedback-gesteuerte Metakognition zur Entwicklung von selbstgesteuertem und gelenktem Lernen\",\n            \"sectionHeader4\": \"\\xdcben, \\xfcben, \\xfcben und wiederholen\",\n            \"section4\": \"Wie jede F\\xe4higkeit, die sich lohnt, erfordert auch die Softwareentwicklung und insbesondere die Programmierung konsequente \\xdcbung, um sie zu beherrschen. Unser Lehrplan hat einen ausgepr\\xe4gten Schwerpunkt auf Wiederholungen, die es den Sch\\xfclern erm\\xf6glichen, innerhalb eines relativ kurzen Zeitraums Sicherheit zu erlangen. Die Strategie besteht darin, ein Muskelged\\xe4chtnis f\\xfcr die grundlegenden Mechanismen aufzubauen, um den Kopf frei zu bekommen f\\xfcr das Erlernen fortgeschrittener F\\xe4higkeiten und die Konzentration auf Designentscheidungen auf h\\xf6herer Ebene.\",\n            \"sectionHeader5\": \"Anspruchsvolle Kreativprojekte\",\n            \"section5\": \"Softwareentwicklung ist eine intellektuell und emotional anspruchsvolle Disziplin. Der zuverl\\xe4ssigste Weg, um die Motivation zu entwickeln, diesen Schwierigkeiten zu widerstehen und sein Wissen kontinuierlich zu erweitern, ist die Arbeit an spannenden, pers\\xf6nlichen kreativen Projekten. Keine Disziplin \\xfcbertrumpft die Energie, die entsteht, wenn man sich f\\xfcr eine kreative Idee begeistert. Wir ermutigen die Sch\\xfclerinnen und Sch\\xfcler, sich solchen Herausforderungen zu stellen, auch wenn sie etwas au\\xdferhalb ihrer derzeitigen M\\xf6glichkeiten zu liegen scheinen, und helfen ihnen dabei, die begonnenen Projekte zu Ende zu bringen.\",\n            \"sectionHeader6\": \"Mentoring Programm\",\n            \"section6\": \"Wir sind davon \\xfcberzeugt, dass die Beziehung zu einem Mentor der Schl\\xfcssel f\\xfcr eine nachhaltige Entwicklung \\xfcber die Zwischenstufe hinaus in jeder Disziplin ist. Unser Ziel ist es, solche Bindungen zwischen den Studenten der Akademie und Mitgliedern unserer Gemeinschaft zu f\\xf6rdern. Im Rahmen unseres Mentorenprogramms arbeiten wir mit den Studenten an Projekten im Studio und bringen dich mit Mentoren zusammen, individuell unterst\\xfctzen k\\xf6nnen. Wir hoffen, dass wir jedem Alumni  helfen k\\xf6nnen, eine dauerhafte Beziehung zu einem Mentor aufzubauen, der bei den n\\xe4chsten Schritten einer beruflichen Entwicklung begleiten und unterst\\xfctzen kann..\"\n        },\n        \"block4\": {\n            \"header\": \"Treffen Sie die Ausbilder\",\n            \"picAlt1\": \"Klassenzimmer\",\n            \"picAlt2\": \"1. Camp Klassenzimmer\",\n            \"picAlt3\": \"Val und Christina programmieren\",\n            \"picAlt4\": \"Code Camp Alumni\"\n        },\n        \"block5\": {\n            \"header\": \"Pfad des Lernens\",\n            \"sectionHeader1\": \"Orientierung & Software Entwicklungsgrunds\\xe4tze\",\n            \"section1Part1\": \"Der Kurs beginnt mit einer kurzen Tour durch den Softwareentwicklungskosmos, beginnend mit Bits & Bytes, \\xfcber Computerhardware bis hin zu einem \\xdcberblick \\xfcber die vielen Zweige der Softwareanwendungen.\",\n            \"section1Part2\": \"Wir machen uns auch mit den Handwerkszeugen vertraut, die Softwareentwickler t\\xe4glich verwenden, und \\xfcben ihre Anwendung, indem wir eine gemeinsame Rezeptsammlung erstellen.\",\n            \"sectionHeader2\": \"Programmierung in Typescript\",\n            \"section2\": `Obwohl das Programmieren nur eine von vielen Fähigkeiten in der Softwareentwicklung ist, ist es der Schlüssel zu ihrer Leistungsfähigkeit. Ausgehend von \"Hello World\" werden wir eine Sammlung kleiner Programme mit zunehmender Komplexität erstellen und dabei nicht nur die Syntax und Grammatik der Programmiersprache Typescript, sondern auch die Prinzipien und Techniken lernen, die allen Programmiersprachen gemeinsam sind.`,\n            \"sectionHeader3\": \"One Page Love\",\n            \"section3\": \"Unser n\\xe4chstes Ziel ist es, uns mit den Technologien vertraut zu machen, mit denen das Web betrieben wird, und grundlegende Kenntnisse im User Interface Design zu erwerben. Wir beginnen mit einer praktischen Einf\\xfchrung in den Human Centered Design-Prozess. Wir werden eine Iteration der Designschritte durchlaufen - von der Recherche bis hin zum Prototyping und Testen. Anschlie\\xdfend werden wir mehrere Websites, die f\\xfcr unterschiedliche Anwendungsf\\xe4lle erstellt wurden, analysieren und sorgf\\xe4ltig rekonstruieren. Wir werden uns mit Designsystemen, Farbtheorie und Typografie besch\\xe4ftigen. Am Ende des Moduls wird jeder ein pers\\xf6nliches Website-Projekt entwerfen und erstellen, das das erste Element in seinem Portfolio werden kann. Die Projekte werden durch den Aufbau einer Informationsarchitektur dokumentiert.\",\n            \"sectionHeader4\": \"Ansprechend gestalten\",\n            \"section4\": `“Mobile first\" ist ein beliebter Ansatz für moderne Produkte und Dienstleistungen. In dieser Phase des Lehrplans werden wir dir beibringen, wie man Webseiten gestaltet, die sich bequem an jedes Gerät anpassen lassen, sowie einige grundlegende Designpraktiken wie Navigationsdesign, Mobile Stacking und Responsive Design. Dann wenden wir das Gelernte auf Ihre persönliche Website an.`,\n            \"sectionHeader5\": \"Wochenr\\xfcckblick und erster Hackathon\",\n            \"section5\": \"Es ist an der Zeit, den bisher gelernten Stoff aufzufrischen und zu reflektieren. In dieser Woche wird es kein neues Material geben. Nur individuelle Check-in-Sitzungen, Gelegenheiten, Ihre F\\xe4higkeiten durch gezieltes \\xdcben zu festigen, und ein Hackathon, um Ihr Vertrauen in Ihre noch jungen F\\xe4higkeiten zu st\\xe4rken.\",\n            \"sectionHeader6\": \"Vollwertige Web-Anwendung\",\n            \"section6\": \"Zu Beginn der zweiten H\\xe4lfte des Kurses werden wir eine komplexere Webanwendung entwerfen und erstellen. Nachdem wir gemeinsam einen Produktdesignprozess durchlaufen haben, werden wir einen Prototyp erstellen und die Benutzeroberfl\\xe4che entwickeln. Dies ist eine Gelegenheit, alle Komponenten eines professionellen Softwareentwicklungsprozesses in allen Einzelheiten zu betrachten und in einer kontrollierten Umgebung zu \\xfcben.\",\n            \"sectionHeader7\": \"Backend Engineering\",\n            \"section7\": \"Um die Kenntnisse abzurunden, werden wir das Backend unserer Webanwendung erstellen und bereitstellen. Dies ist der anspruchsvollste Teil des Kurses, da es normalerweise viel Zeit braucht, um die Komplexit\\xe4t eines Backends auf Produktionsebene zu meistern, einschlie\\xdflich Authentifizierung, Datenbankdesign &amp; kontinuierliche Bereitstellung. Aber mit viel Konzentration, sorgf\\xe4ltig ausgearbeiteten Anweisungen und ein bisschen um die Ecke denken, werden Sie in der Lage sein, eine vollst\\xe4ndige Webanwendung von Anfang bis Ende selbst zu erstellen.\",\n            \"sectionHeader8\": \"Professionelles Rahmenwerk mit Spezialisierung\",\n            \"section8\": \"Unsere letzten Wochen des formalen Lehrplans f\\xfchren die Studierenden durch professionelle Entwicklungsprozesse und bieten grundlegende Einstiegsm\\xf6glichkeiten f\\xfcr interessierte Studierende, um tiefer in Spezialisierungen wie Backend-Entwicklung & DevOps, Data Science, UI/UX-Design und Agile Management einzutauchen. Wir werden auch unseren zweiten Hackathon nutzen, um das Abschlussprojekt zu starten.\",\n            \"sectionHeader9\": \"Abschlussprojekt und zweiter Hackathon\",\n            \"section9\": \"Nach 18 Wochen intensiver Schulung hast du alles, was du brauchst, um dich mit Mitcampern zusammenzutun und eure eigenen Projekte zu entwickeln. Zus\\xe4tzliche Unterst\\xfctzung erh\\xe4ltst du von Mentoren aus unserer Community, die dich technisch unterst\\xfctzen und dir auch dabei helfen, Optionen f\\xfcr das Leben nach dem Kurs zu finden. Die letzte Woche besteht aus einem zweit\\xe4gigen Karriereentwicklungsprogramm und unserem letzten Hackathon, um die letzten Projekte abzuschlie\\xdfen.\",\n            \"sectionHeader10\": \"ENDE\",\n            \"section10\": \"Abschluss\"\n        },\n        \"block6\": {\n            \"header\": \"Bisherigen Alumni Einstellungen\"\n        },\n        \"block7\": {\n            \"header\": \"Studiengeb\\xfchren & Finanzierung\",\n            \"part1\": \"Unser Ziel ist es, das Code Camp so zug\\xe4nglich wie m\\xf6glich zu machen, und wir bem\\xfchen uns, die Kosten f\\xfcr die Teilnehmer so gering wie m\\xf6glich zu halten.\",\n            \"part2\": \"Die Teilnahmegeb\\xfchr f\\xfcr das 23-w\\xf6chige Vollzeitprogramm Code Camp betr\\xe4gt #.\" /* # is the camp price */ ,\n            \"part3\": \"Unser Ziel ist es, das Code Camp so zug\\xe4nglich wie m\\xf6glich f\\xfcr qualifizierte Kandidaten zu machen.\",\n            \"part4\": \"Wir bieten Ihnen eine Reihe von Optionen zur Finanzierung Ihres Studiums, darunter Zahlungspl\\xe4ne, staatliche Programme, Darlehenspartner und Stipendien. Setz dich mit uns in Verbindung, damit wir die f\\xfcr dich passenden Finanzierungsm\\xf6glichkeiten pr\\xfcfen k\\xf6nnen.\",\n            \"part5\": `Wenn Sie Anspruch auf Ausbildungsförderung durch das Jobcenter haben und Ihren Studienplatz über einen Bildungsgutschein finanzieren möchten, wenden Sie sich bei Fragen an #.`,\n            \"callLink\": \"Anruf oder Chat vereinbaren\"\n        },\n        \"block8\": {\n            \"header\": \"Bewerbungsprozess\",\n            \"sectionHeader1\": \"Step 1\",\n            \"section1\": \"Online-Formular, damit wir uns ein Bild davon machen k\\xf6nnen, wie Sie Ihre Zeit bisher verbracht haben und was Ihre Motivation ist, bei Devhaus mitzumachen.\",\n            \"sectionHeader2\": \"Step 2\",\n            \"section2Part1\": \"Interview mit zwei Mitgliedern des Devhaus-Teams, um deinen Weg zu besprechen und wie Devhaus eine sich auf deine Lebensweise auswirkt\",\n            \"section2Part2\": \"Unser Team entscheidet \\xfcber die Bewerbungen, sobald sie eingegangen sind. Das bedeutet, dass die Bewerberenden  innerhalb von 30 Tagen mit einer Entscheidung rechnen k\\xf6nnen, unabh\\xe4ngig davon, wann sie sich bewerben.\",\n            \"applyLink\": \"Jetzt bewerben\"\n        }\n    },\n    \"studio\": {\n        \"header\": \"Studio\",\n        \"subheader\": \"Ob es sich um ein pers\\xf6nliches oder berufliches Projekt handelt, unsere Bewohner finden Unterst\\xfctzung bei der Verwirklichung ihrer Ziele.\",\n        \"ongoingProjects\": {\n            \"header\": \"Laufende Projekte\",\n            \"fillip\": \"Fillip - Eine leistungsstarke Plattform f\\xfcr Online-Veranstaltungen\",\n            \"learningPlatform\": \"Die Lernplattform des Code Camp Leipzig\",\n            \"devhausRebrand\": \"Devhaus Rebranding - Der \\xdcbergang vom Code Camp zum Devhaus Leipzig\"\n        },\n        \"pastProjects\": {\n            \"header\": \"Vergangene Projekte\",\n            \"klocator\": \"KLOcator - Abschlussprojekt Camp #4\",\n            \"weAreFamily\": \"Wir sind eine Familie - Global Game Jam 2021\",\n            \"devhausNetwork\": \"Abschlussprojekt Camp #3 - Ein soziales Netzwerk f\\xfcr angehende Entwickler\",\n            \"plantSwap\": \"Plant Swap - Eine Pflanzen-Tausch-App im Stil von Tinder\",\n            \"pokedex\": \"Ein klassischer Pokedex mit eingebauter Gesichtserkennung in 6 Stunden\",\n            \"hairdresser\": \"Code Camp-Absolventen bauen gemeinsam eine Website f\\xfcr einen Friseur in M\\xfcnchen\",\n            \"skitme\": \"Skitme - Ein wahnsinnig unterhaltsames Zeichenspiel, das am Ende von Camp #2 entwickelt wurde\",\n            \"curryOn\": \"Curry On! - Erleben Sie die ultimative Currywurst-Challenge\",\n            \"hackerPub\": \"Hacker Kneipen Quiz\",\n            \"communic\": \"Communic - Eine soziale Plattform, um Projekte zu finden und zu ihnen beizutragen\"\n        }\n    },\n    \"stories\": {\n        \"header\": \"\",\n        \"categories\": {\n            \"interview\": \"Interview\",\n            \"article\": \"Artikel\",\n            \"panel\": \"Podiumsdiskussion\",\n            \"storySeries\": \"Geschichten Serie\",\n            \"hackathon\": \"Hackathon\"\n        },\n        \"aWildRide\": `“Eine wilde Reise”: Code Camp Leipzig wird ein Jahr alt`,\n        \"smartInfrastructure\": \"Code Camp Leipzig wird vom Smart Infrastructure Hub Leipzig mit dem RE-START Award ausgezeichnet\",\n        \"startupSafari\": `Podiumsdiskussion Startup Safari: “Entwicklung von Fähigkeiten für eine digitale Welt”`,\n        \"hypezig\": \"Wie kann Leipzig Hypezig bleiben?: Leipzig’s Transformation in ein IT Zentrum\",\n        \"tales\": \"Geschichten vom Code Camp #1\",\n        \"codemotion\": \"Codemotion Berlin 2019 Community Interview mit Simon\",\n        \"retailHackathon\": \"Shopping ideas for the future: Retail Hackathon at Leipzig's H\\xf6fe am Br\\xfch\"\n    },\n    \"contact\": {\n        \"header\": \"Konatkt\",\n        \"subheader\": \"Wir freuen uns \\xfcber ein Treffen und ein Gespr\\xe4ch.\",\n        \"germany\": \"Deutschland\"\n    },\n    \"about\": {\n        \"header\": \"\\xdcber Devhaus Leipzig\",\n        \"sectionPart1\": \"Wir sind davon \\xfcberzeugt, dass die Softwareentwicklung eine der erf\\xfcllendsten und bef\\xe4higendsten kreativen Disziplinen in der heutigen Welt ist. Gleichzeitig ist die Beherrschung ihrer vielen Facetten eine anspruchsvolle, lebenslange Herausforderung. Eine Herausforderung, die sich unserer Meinung nach am besten mit der Unterst\\xfctzung einer starken Gemeinschaft bew\\xe4ltigen l\\xe4sst, in der die Mitglieder voneinander lernen und sich auf ihrem pers\\xf6nlichen und beruflichen Weg zusammentun. Was als Code-Camp begann, um Anf\\xe4ngern das Programmieren beizubringen und eine Karriere in der Softwareentwicklung zu finden, hat sich schnell zu einer solchen Gemeinschaft entwickelt.\",\n        \"sectionPart2\": \"Ob in Kursen und Workshops in der Akademie, in pers\\xf6nlichen oder professionellen Projekten im Atelier oder durch die Teilnahme an unseren Veranstaltungen; die Mitglieder des Devhaus Leipzig bem\\xfchen sich, ein lebendiges Umfeld zu schaffen, in dem jeder Unterst\\xfctzung findet, um seine technischen und kreativen F\\xe4higkeiten zu entwickeln.\",\n        \"role\": {\n            \"taylor\": \"CEO & Co-Founder\",\n            \"franz\": \"Instructor & Co-Founder\",\n            \"gabriel\": \"Co-Founder\",\n            \"dan\": \"Lehrkraft\",\n            \"valeria\": \"Lehrkraft\",\n            \"sven\": \"Lehrkraft\",\n            \"vera\": \"Studio Resident\",\n            \"moritz\": \"Studio Resident\",\n            \"felix\": \"Studio Resident\"\n        }\n    },\n    \"privacy\": {\n        \"header1\": \"Datenschutz Bestimmungen\",\n        \"section1\": `Diese Datenschutzrichtlinie (\"Richtlinie\") beschreibt, wie die persönlich identifizierbaren\n        Informationen (\"Persönliche Informationen\"), die du auf der\n        devhausleipzig.de-Website (\"Website\" oder \"Service\") und alle damit\n        zugehörigen Produkte und Dienstleistungen (zusammenfassend \"Dienstleistungen\") gesammelt,\n        geschützt und verwendet werden. Sie beschreibt auch die dir zu Verfügung stehenden Wahlmöglichkeiten\n        in Bezug auf die Verwendung deiner persönlichen Daten und wie diese Daten\n        und Informationen aktualisiert werden können. Diese Richtlinie ist eine rechtsverbindliche Vereinbarung\n        zwischen dir (\"Nutzer\", “du\" oder \"ihr\") und der Code Camp Leipzig UG (\"Code\n        Camp Leipzig UG\", \"wir\", \"uns\" oder \"unser\"). Durch den Zugriff und die Nutzung der\n        Website und der Dienstleistungen bestätigst du, dass du die Bedingungen gelesen und verstanden hast und dich damit einverstanden erklärst, an die Bedingungen dieser Vereinbarung gebunden zu sein. Diese Richtlinie gilt\n        nicht für die Handlungen von Unternehmen, die wir nicht besitzen oder kontrollieren,\n        oder für Personen, die wir nicht beschäftigen oder verwalten.`,\n        \"header2\": `Automatische Erfassung von Informationen`,\n        \"section2\": `Wenn du die Website öffnest, zeichnen unsere Server automatisch Informationen auf\n        die dein Browser sendet. Diese Daten können Informationen enthalten wie die\n        IP-Adresse deines Geräts, Browsertyp und -version, Typ und Version des Betriebssystems, Spracheinstellungen oder die Webseite, die du besucht hast,\n        bevor du auf die Website und die Dienste gekommen bist, sowie die Seiten der Website und der Dienste\n        die du besuchst, die Zeit, die du auf diesen Seiten verbringst, Informationen, die du auf der Website suchst\n        ,Zugriffszeiten und -daten sowie andere Statistiken.\n        Automatisch gesammelte Informationen werden nur verwendet, um potenzielle\n        Missbrauchsfälle zu identifizieren und statistische Informationen über die Nutzung\n        und den Verkehr der Website und der Dienste zu erstellen. Diese statistischen Informationen werden nicht anderweitig gesammelt, welches die Identifizierung eines\n        bestimmten Benutzers des Systems betreffen könnte.`,\n        \"header3\": `Erhebung von personenbezogenen Daten`,\n        \"section3\": `Du kannst auf die Website und die Dienste zugreifen und diese nutzen, ohne uns mitzuteilen, wer du bist, oder Informationen preiszugeben, anhand derer man dich\n        als eine bestimmte Person identifizieren könnte. Wenn du jedoch\n        Funktionen der Website nutzen möchtest, wirst du möglicherweise aufgefordert, bestimmte\n        Persönliche Informationen zu teilen (zum Beispiel Name und E-Mail-Adresse). Wir\n        erhalten und speichern alle Informationen, die du uns wissentlich zur Verfügung stellst. Zum Beispiel wenn du Online-Formulare auf der Website ausfüllst. Falls erforderlich, können diese Formulare \n        folgende Informationen enthalten:`,\n        \"section3bullet1\": `Persönliche Angaben wie Name, Land des Wohnsitzes, etc..`,\n        \"section3bullet2\": ` Geographische Standorte wie Breitengrad und Längengrad.`,\n        \"header4\": `Verwendung und Verarbeitung der gesammelten Informationen`,\n        \"section4part1\": `Um dir die Website und die Dienste zur Verfügung zu stellen und um eine\n        rechtliche Verpflichtung zu erfüllen, müssen wir bestimmte persönliche\n        Informationen speichern. Wenn du die von uns angeforderten Informationen nicht bereitstellst, sind wir\n        möglicherweise nicht in der Lage, dir die angeforderten Produkte oder Dienstleistungen zur Verfügung zu stellen.\n        Alle Informationen, die wir von dir sammeln, können für folgende Zwecke verwendet werden\n        Zwecke:`,\n        \"section4part1bullet1\": `Verbesserung von Produkten und Dienstleistungen`,\n        \"section4part1bullet2\": `Verbesserung der Benutzerfreundlichkeit`,\n        \"section4part1bullet3\": `Durchsetzung der Geschäftsbedingungen`,\n        \"section4part1bullet4\": `Schutz vor Missbrauch und böswilligen Nutzern`,\n        \"section4part1bullet5\": `Reaktionen auf Anfragen und abwenden von Schaden`,\n        \"section4part1bullet6\": `Betrieb der Website und der Dienste`,\n        \"section4part2\": `Beachte, dass wir nach einigen Gesetzen berechtigt sein können\n        Daten zu verarbeiten, bis du einer solchen Verarbeitung widersprichst (durch Opt-out). \n        Bis dahin sind wir nicht verpflichtet uns auf eine Einwilligung oder eine andere der folgenden Rechtsgrundlagen zu berufen. In jedem Fall sind wir gerne bereit, die spezifische Rechtsgrundlage zu erläutern,\n        die für die Verarbeitung gilt, und insbesondere, ob die Bereitstellung\n        der personenbezogenen Daten eine gesetzliche oder vertragliche Verpflichtung ist oder\n        für den Abschluss eines Vertrags erforderlich ist.`,\n        \"section4part3\": `Beachte, dass wir nach einigen Gesetzen berechtigt sein können\n        Daten zu verarbeiten, bis du einer solchen Verarbeitung widersprechen (durch Opt-out), ohne\n        ohne dass wir uns auf eine Einwilligung oder eine andere der folgenden Rechtsgrundlagen \n        berufen müssen. In jedem Fall sind wir gerne bereit, die spezifische Rechtsgrundlage zu erläutern,\n        die für die Verarbeitung gilt, und insbesondere, ob die Bereitstellung\n        der personenbezogenen Daten eine gesetzliche oder vertragliche Verpflichtung ist oder\n        für den Abschluss eines Vertrags erforderlich ist.`,\n        \"header5\": `Offenlegung von Daten`,\n        \"section5part1\": `Abhängig von den angeforderten Diensten oder wenn es für den Abschluss einer Transaktion oder die Erbringung eines vo dir angeforderten Dienstes erforderlich ist, können wir deine Daten mit deiner Zustimmung an unsere vertrauenswürdigen Dritten, die mit uns zusammenarbeiten, sowie an andere verbundene Unternehmen und Tochtergesellschaften weitergeben, auf die wir uns verlassen, um den Betrieb der Website und der dir zur Verfügung stehenden Dienste zu unterstützen. Wir geben keine persönlichen Daten an nicht angeschlossene Dritte weiter. Diese Dienstleister sind nicht befugt, deine Daten zu verwenden oder weiterzugeben, es sei denn, dies ist erforderlich, um Dienstleistungen in unserem Namen zu erbringen oder gesetzliche Anforderungen zu erfüllen. Wir dürfen deine persönlichen Daten zu diesen Zwecken nur an Dritte weitergeben, deren Datenschutzrichtlinien mit unseren übereinstimmen oder die sich bereit erklären, unsere Richtlinien in Bezug auf persönliche Daten zu befolgen. Diese Dritten erhalten personenbezogene Daten, die sie nur zur Erfüllung der dir zugewiesenen Aufgaben benötigen, und wir ermächtigen sie nicht, personenbezogene Daten für ihre eigenen Marketing- oder sonstigen Zwecke zu verwenden oder offenzulegen.`,\n        \"section5part2\": `Wir werden alle persönlichen Daten, die wir sammeln, verwenden oder erhalten, offenlegen, wenn dies\n        gesetzlich vorgeschrieben oder erlaubt ist, z. B. um einer Vorladung nachzukommen, oder\n        und wenn wir in gutem Glauben davon ausgehen, dass die Offenlegung\n        notwendig ist, um unsere Rechte zu schützen, deine Sicherheit oder die Sicherheit\n        anderer zu schützen, Betrug zu untersuchen oder auf eine staatliche Anfrage zu reagieren.`,\n        \"section5part3\": `Falls wir einen geschäftlichen Übergang durchlaufen, wie z.B. eine Fusion oder\n        Übernahme durch ein anderes Unternehmen oder den Verkauf des gesamten oder eines Teils des\n        Vermögenswerte, werden dein Benutzerkonto und deine persönlichen Daten wahrscheinlich zu den\n        den übertragenen Vermögenswerten.`,\n        \"header6\": `Umgang mit Daten`,\n        \"section6\": `Wir werden deine persönlichen Daten für den Zeitraum aufbewahren und verwenden\n        der notwendig ist, um unseren rechtlichen Verpflichtungen nachzukommen, Streitigkeiten beizulegen und\n        und unsere Vereinbarungen durchzusetzen, es sei denn, eine längere Aufbewahrungsfrist ist erforderlich oder\n        gesetzlich zulässig. Wir können alle gesammelten Daten verwenden, die deine persönlichen Informationen enthalten, nachdem du diese aktualisiert oder gelöscht hast,\n        jedoch nicht in einer Weise, die dich persönlich identifizierbar macht . Sobald die\n        Aufbewahrungsfrist abläuft, werden die personenbezogenen Daten gelöscht.\n        Daher werden das Recht auf Auskunft, das Recht auf Löschung, das Recht auf\n        Recht auf Berichtigung und das Recht auf Datenübertragbarkeit nach dem Ablauf der Aufbewahrungsfrist nicht mehr durchgesetzt.`,\n        \"header7\": `Weitergabe von Informationen`,\n        \"section7\": `Je nach deinem Standort kann die Datenübertragung die Übertragung und Speicherung\n        deiner Informationen in einem anderen Land als deinem Heimatland stattfinden. Du hast\n        das Recht, dich über die Rechtsgrundlage der Datenübermittlung in ein Land\n        Land außerhalb der Europäischen Union oder an eine internationale Organisation\n        die dem Völkerrecht unterliegt oder von zwei oder mehr Ländern gegründet wurde,\n        wie z. B. die UNO, und über die von uns getroffenen Sicherheitsmaßnahmen zum Schutz\n        deiner Informationen zu informieren. Wenn eine solche Übermittlung stattfindet, kannst du mehr darüber erfahren, indem du die entsprechenden Abschnitte dieser Richtlinie liest oder dich mit den im Abschnitt \"Kontakt\" angegebenen Informationen beschäftigst.`,\n        \"header8\": `Benutzerrecht`,\n        \"section8\": `Du kannst bestimmte Rechte in Bezug auf deine von uns verarbeiteten Daten ausüben\n        uns. Insbesondere hast du das Recht, Folgendes zu tun: (i) Du hast\n        das Recht, deine Einwilligung zu widerrufen, wenn du zuvor der\n        Verarbeitung deiner Daten stattgegeben hast; (ii) Du hast das Recht\n        Widerspruch gegen die Verarbeitung deiner Daten einzulegen, wenn die Verarbeitung\n        auf einer anderen Rechtsgrundlage als der Einwilligung erfolgt; (iii) Du hast das\n        Recht zu erfahren, ob Daten von uns verarbeitet werden, und\n        über bestimmte Aspekte der Verarbeitung zu erfahren und eine Kopie der Daten zu erhalten; (iv) Du hast das Recht, die Richtigkeit deiner Daten zu überprüfen und deren Aktualisierung oder Korrektur zu verlangen. (v) Du hast das Recht, unter bestimmten Umständen\n        die Verarbeitung deiner Daten einzuschränken; in diesem Fall werden wir deine Daten nicht für andere Zwecke als die Speicherung verarbeiten; (vi) Du hast unter bestimmten Umständen das Recht, die Löschung deiner Daten anzufordern.\n        (vii) Du hast das Recht, deine Daten in einem strukturierten, allgemein gebräuchlichen und maschinenlesbaren Format zu erhalten und sie, sofern technisch möglich, an einen anderen für die Verarbeitung Verantwortlichen zu übermitteln. Diese Bestimmung ist anwendbar, wenn\n        deine Daten mit Hilfe automatisierter Verfahren verarbeitet werden und die\n        Verarbeitung auf deiner Einwilligung, auf einem Vertrag, an dem du beteiligt bist\n        oder auf vorvertraglichen Verpflichtungen basiert.`,\n        \"header9\": `Widerspruchsrecht gegen die Verarbeitung`,\n        \"section9\": `Wenn personenbezogene Daten im öffentlichen Interesse verarbeitet werden, in\n        Ausübung einer uns übertragenen öffentlichen Gewalt oder für die Zwecke\n        der von uns verfolgten berechtigten Interessen verarbeitet werden, kannst du gegen diese\n        Verarbeitung widersprechen, indem du einen Grund angibst, der sich auf deine besondere Situation bezieht und\n        den Widerspruch rechtfertigt. Du musst jedoch wissen, dass, sollten deine persönlichen\n        Informationen für Zwecke der Direktwerbung verarbeitet werden, kannst du\n        dieser Verarbeitung jederzeit und ohne Angabe von Gründen widersprechen. Um\n        zu erfahren, ob wir personenbezogene Daten für Direktmarketingzwecke verarbeiten, kannst du auf die entsprechenden Abschnitte dieses\n        Dokuments schauen.`,\n        \"header10\": `Datenschutzrechte nach GDPR`,\n        \"section10part1\": `Wenn du im Europäischen Wirtschaftsraum (EWR) ansässig bist, hast du\n        bestimmte Datenschutzrechte und die Code Camp Leipzig UG ist bestrebt\n        Maßnahmen zu ergreifen, die es dir ermöglichen, deine persönlichen Daten zu korrigieren, zu ändern, zu löschen oder die Verwendung deiner persönlichen Daten einzuschränken. Wenn du informiert werden möchten, welche persönlichen Daten wir über dich gespeichert haben, und wenn du möchtest, dass diese\n        aus unseren Systemen entfernt werden, kontaktiere uns bitte. Unter bestimmten Umständen hast du\n        die folgenden Datenschutzrechte::`,\n        'section10part1bullet1': `Du hast das Recht, Zugang zu deinen persönlichen Daten zu verlangen, die\n        wir speichern und die Möglichkeit, auf deine persönlichen Daten zuzugreifen.`,\n        'section10part1bullet2': `Du hast das Recht, uns aufzufordern, persönliche Daten zu korrigieren, die du für unrichtig hältst. Du hast auch das Recht, uns aufzufordern\n        die persönlichen Daten, die du für unvollständig hältst, zu vervollständigen.`,\n        'section10part1bullet3': `Du hast unter bestimmten Voraussetzungen das Recht deine persönlichen Daten löschen zu lassen.`,\n        'section10part1bullet4': `Du hast das Recht der Verarbeitung deiner persönlichen Daten durch uns zu widersprechen.`,\n        'section10part1bullet5': `Du hast das Recht, eine Einschränkung der Verarbeitung deiner\n        persönlichen Informationen zu verlangen. Wenn du die Verarbeitung deiner persönlichen Daten einschränkst, können wir diese speichern, werden sie aber nicht weiter verarbeiten.`,\n        'section10part1bullet6': `Du hast das Recht, eine Kopie der Informationen, die wir über dich haben, in einem strukturierten, maschinenlesbaren und allgemein gebräuchlichen\n        Format zu erhalten.`,\n        'section10part1bullet7': `Du hast auch das Recht, jederzeit deine Einwilligung für all das zu widerrufen, wofür\n        Code Camp Leipzig UG deine Einwilligung zur Verarbeitung deiner persönlichen\n        Informationen benötigte.`,\n        \"section10part2\": `Du hast das Recht, dich bei einer Datenschutzbehörde über unsere\n        Erhebung und Verwendung deiner persönlichen Daten zu beschweren. Für weitere Informationen,\n        Wende dich ich bitte an deine lokale Datenschutzbehörde im Europäischen\n        Wirtschaftsraum (EWR).`,\n        \"header11\": `Kalifornische Datenschutzrechte`,\n        \"section11\": `Zusätzlich zu den in dieser Richtlinie erläuterten Rechten sind Einwohner Kaliforniens, die persönliche Daten (wie im Gesetz definiert) angeben\n        um Produkte oder Dienstleistungen für den persönlichen Gebrauch, die Familie oder den Haushalt zu beziehen, dazu berechtigt einmal pro Kalenderjahr von uns folgende Informationen zu verlangen und zu erhalten, die wir gegebenenfalls an andere\n        Unternehmen zu Marketingzwecken weitergegeben haben. Falls zutreffend, würden diese Informationen\n        die Kategorien der personenbezogenen Daten sowie die Namen und Adressen der Unternehmen, mit denen wir solche personenbezogenen\n        Informationen für das unmittelbar vorangegangene Kalenderjahr weitergegeben haben (z. B. erhaltene Anfragen, die im laufenden Jahr gestellt wurden, Informationen über das vorangegangene Jahr). Um\n        diese Informationen zu erhalten, melde dich bei uns.`,\n        \"header12\": `Wie ist die Ausübung dieser Rechte?`,\n        \"section12\": `Alle Anfragen zur Ausübung Ihrer Rechte können an die Code Camp\n        Leipzig UG über die in diesem Dokument angegebenen Kontaktinformationen richten. Bitte\n        Bitte beachten Sie, dass wir dich bitten können, deine Identität zu überprüfen, bevor wir auf\n        solche Anfragen antworten. Deine Anfrage muss ausreichende Informationen enthalten, die\n        die es uns ermöglichen, zu überprüfen, ob du die Person bist, die du vorgibst zu sein, oder\n        dass du der bevollmächtigte Vertreter einer solchen Person bist. \n        Die Anfragen sollten genügend Details enthalten, damit wir die Anfrage richtig verstehen\n        und zu beantworten können. Wir können nicht auf deine Anfrage antworten. \n        Persönliche Daten können wir nur dann beantwortet oder dir zur Verfügung zu stellen, wenn wir zuerst deine Identität bzw. deine Berechtigung überprüfen und bestätigen.`,\n        \"header13\": `Privatsphäre von Kindern`,\n        \"section13\": `Wir sind uns der Notwendigkeit bewusst, weitere Datenschutzmaßnahmen in Bezug auf\n        in Bezug auf persönliche Daten, die wir von Kindern erheben, und treffen\n        viele besondere Vorsichtsmaßnahmen, um die Privatsphäre von Kindern zu schützen. Wir verlangen nicht\n        von einem Kind nicht mehr Informationen, als für die Nutzung der\n        notwendig ist, um die Website und die Dienste zu nutzen. Wir ermutigen Kinder dazu\n        sich mit ihren Eltern abzusprechen, bevor sie Informationen an eine\n        Online-Ressourcen teilen, einschließlich unserer Website und weitere Dienste. Wir glauben, dass Eltern\n        in die Online-Aktivitäten ihrer Kinder einbezogen werden sollten und\n        empfehlen, dass Eltern ihr Bestes tun, um ihren Kindern eine sichere und\n        und freundlichen Online-Umgebung zu ermöglichen.`,\n        \"header14\": `Cookies`,\n        \"section14part1\": `Die Website und die Dienste verwenden \"Cookies\", um dir das \n        Online-Erlebnis zu personalisieren. Ein Cookie ist eine Textdatei, die von einem Webserver auf Ihrer\n        Festplatte von einem Webserver abgelegt wird. Cookies können nicht verwendet werden, um Programme auszuführen\n        oder Viren auf Ihren Computer zu übertragen. Cookies sind Ihnen eindeutig zugeordnet\n        Ihnen zugeordnet und können nur von einem Webserver in der Domäne gelesen werden, die das\n        Cookie an Sie ausgegeben hat.`,\n        \"section14part2\": `Wir können Cookies verwenden, um Informationen zu sammeln, zu speichern und zu verfolgen\n        statistischen Zwecken für den Betrieb der Website und der Dienste. Sie haben die\n        die Möglichkeit, Cookies zu akzeptieren oder abzulehnen. Die meisten Webbrowser akzeptieren automatisch\n        akzeptieren Cookies, aber Sie können Ihre Browser-Einstellungen in der Regel so ändern\n        Cookies abzulehnen, wenn Sie dies wünschen. Wenn Sie mehr über Cookies und deren\n        verwalten können, besuchen Sie #`,\n        \"header15\": `Do Not Track Signale`,\n        \"section15\": `Einige Browser verfügen über eine \"Do Not Track\"-Funktion, die den\n        Websites, die du besuchst, signalisiert, dass du nicht möchtest, dass  Online-Aktivitäten\n        nachverfolgt werden. Tracking ist nicht dasselbe wie die Verwendung oder Sammlung von Informationen in\n        Verbindung mit einer Website. Für diese Zwecke bezieht sich Tracking auf\n        das Sammeln persönlich identifizierbarer Informationen von Verbrauchern, die eine Website oder einen Online-Dienst nutzen oder. Die Website und die Dienste verfolgen ihre Besucher nicht im Laufe der Zeit\n        und über die Websites von Dritten. Einige Websites von Drittanbietern können jedoch\n        Ihre Browsing-Aktivitäten aufzeichnen, wenn sie dir Inhalte anbieten,\n        Dadurch kannst du die Inhalte, die sie dir präsentieren, besser auf dich zuschneiden.`,\n        \"header16\": `Werbeanzeigen`,\n        \"section16\": `Wir können bestimmten Drittunternehmen erlauben, uns dabei zu helfen\n        Werbung, die unserer Meinung nach für die Nutzer von Interesse sein könnte, sowie die Sammlung und\n        Daten über die Aktivitäten der Nutzer auf der Website zu sammeln und zu verwenden. Diese Unternehmen können\n        Anzeigen schalten, die möglicherweise Cookies platzieren und das Nutzerverhalten anderweitig verfolgen.`,\n        \"header17\": `E-Mail-Werbung`,\n        \"section17part1\": `Wir bieten elektronische Newsletter an, die du jederzeit freiwillig abonnieren kannst.\n        Wir verpflichten uns, deine E-Mail-Adresse vertraulich zu behandeln\n        und werden deine E-Mail-Adresse nicht an Dritte weitergeben, es sei denn, dies ist in dem Abschnitt über die Nutzung und Verarbeitung von Informationen\n        oder für die Zwecke der Nutzung eines Drittanbieters für den Versand solcher\n        E-Mails. Wir werden die per E-Mail gesendeten Informationen in Übereinstimmung mit\n        mit den geltenden Gesetzen und Vorschriften.`,\n        \"section17part2\": `In Übereinstimmung mit dem CAN-SPAM Act werden alle von uns gesendeten E-Mails\n        deutlich angeben, von wem die E-Mail stammt, und klare Informationen darüber geben\n        wie du den Absender kontaktieren kannst. Du kannst den Empfang unserer\n        Newsletter oder Marketing-E-Mails abbestellen, indem du die Anweisungen zum Abbestellen\n        die in diesen E-Mails enthalten sind, oder indem du dich mit uns in Verbindung setzt.`,\n        \"header18\": `Links to other resources`,\n        \"section18\": `Die Website und die Dienste enthalten Links zu anderen Ressourcen, die nicht\n        uns gehören oder von uns kontrolliert werden. Bitte beachte, dass wir nicht verantwortlich sind\n        für die Datenschutzpraktiken solcher anderer Ressourcen oder Dritter sind. Wir\n        empfehlen dir, beim Verlassen der Website und der Dienste darauf zu achten und\n        die Datenschutzerklärungen jeder einzelnen Ressource zu lesen, die möglicherweise Persönliche Informationen enthalten kann.`,\n        \"header19\": `Sicherheit von Informationen`,\n        \"section19\": `Wir sichern die von dir bereitgestellten Informationen auf Computerservern in einer kontrollierten,\n        sicheren Umgebung, die vor unbefugtem Zugriff, Verwendung oder\n        Offenlegung. Wir unterhalten angemessene administrative, technische und\n        physische Sicherheitsvorkehrungen, um uns vor unbefugtem Zugriff zu schützen,\n        Nutzung, Änderung und Offenlegung der persönlichen Daten, die sich in unserer Kontrolle\n        und Gewahrsam. Allerdings kann keine Datenübertragung über das Internet oder ein drahtloses\n        Netzwerk kann jedoch nicht garantiert werden. Obwohl wir uns daher bemühen, deine\n        Persönliche Daten zu schützen, erkennst du an, dass (i) es Sicherheits- und\n        Datenschutzbeschränkungen des Internets gibt, die außerhalb unserer Kontrolle liegen; (ii)\n        die Sicherheit, die Integrität und der Datenschutz aller Informationen und Daten\n        die zwischen dir und der Website und den Diensten ausgetauscht werden, nicht garantiert werden können;\n        (iii) solche Informationen und Daten während der Übertragung von Dritten eingesehen oder manipuliert werden können\n        während der Übertragung von Dritten eingesehen oder manipuliert werden.`,\n        \"header20\": `Datenschutzverletzung`,\n        \"section20\": `Für den Fall, dass wir feststellen, dass die Sicherheit der Website und\n        Dienste kompromittiert wurde oder die persönlichen Daten der Nutzer\n        als Ergebnis externer Aktivitäten an Dritte weitergegeben wurden,\n        einschließlich, aber nicht beschränkt auf, Sicherheitsangriffe oder Betrug, behalten wir uns das\n        Recht vor, angemessene Maßnahmen zu ergreifen, einschließlich, aber nicht\n        Untersuchung und Berichterstattung sowie die Benachrichtigung von und die\n        Zusammenarbeit mit den Strafverfolgungsbehörden. Im Falle einer Datenverletzung\n        werden wir angemessene Anstrengungen unternehmen, um die betroffenen Personen zu benachrichtigen\n        wenn wir der Meinung sind, dass ein angemessenes Risiko besteht, dass dem Nutzer durch die Verletzung ein Schaden entsteht\n        oder wenn eine Benachrichtigung aus anderen Gründen gesetzlich vorgeschrieben ist,\n        werden wir einen Hinweis auf der Website veröffentlichen, oder dir eine E-Mail senden.`,\n        \"header21\": `Änderungen und Ergänzungen`,\n        \"section21\": `Wir behalten uns das Recht vor, diese Richtlinie oder ihre Bedingungen in Bezug auf die\n        Website und Dienste von Zeit zu Zeit nach unserem Ermessen zu ändern und werden\n        dich über alle wesentlichen Änderungen informieren. In dem Fall, werden wir eine Mitteilung auf der Hauptseite \n        der Website veröffentlichen. Wir können dich auch auf andere Weise auf dem laufenden halten, z. B. über die von dir bereitgestellten Kontaktinformationen. Jede\n        aktualisierte Version dieser Richtlinie tritt unmittelbar mit der\n        Veröffentlichung der überarbeiteten Richtlinie in Kraft, sofern nicht anders angegeben. Deine weitere\n        Nutzung der Website und der Dienste nach dem Datum des Inkrafttretens der überarbeiteten\n        Richtlinie (oder einer anderen zu diesem Zeitpunkt angegebenen Handlung) gilt als deine\n        Zustimmung zu diesen Änderungen. Wir werden jedoch nicht ohne deiner Zustimmung, persönlichen Daten verwenden, die sich wesentlich von dem unterscheidet, was\n        die zum Zeitpunkt der Erhebung deiner persönlichen Daten angegeben wurden.`,\n        \"header22\": `Akzeptanz dieser Strategie`,\n        \"section22\": `Du bestätigst, dass du diese Richtlinie gelesen hast und mit allen darin enthaltenen\n        Bedingungen einverstanden bist. Durch den Zugriff und die Nutzung der Website und der Dienste\n        Stimmst du zu, an diese Richtlinie gebunden zu sein. Wenn du nicht einverstanden bist, die Bedingungen dieser Richtlinie einzuhalten\n        , bist du nicht berechtigt, auf die Website und die Dienste zuzugreifen oder sie zu nutzen.\n        Website und Dienste.`,\n        \"header23\": `Kontaktier uns`,\n        \"section23\": `Wenn du mit uns Kontakt aufnehmen möchtest, um mehr über diese Richtlinie zu erfahren oder\n        uns in Bezug auf deine persönlichen Rechte und Daten ansprechen willst , kannst du eine E-Mail an #`,\n        /* # stands for the contact email address */ \"section24\": `Dieses Dokument wurde zuletzt aktualisiert am #`\n    },\n    \"events\": {\n        \"header\": \"Kommende Veranstaltungen\",\n        \"demoDay\": {\n            \"header\": \"Demo Tag\"\n        },\n        \"camp5Start\": {\n            \"header\": \"Camp #5 Er\\xf6ffnungsveranstaltung\"\n        },\n        \"hackolaus\": {\n            \"header\": \"Hackolaus, veranstaltet von der Open Tech School Leipzig\"\n        }\n    },\n    \"faq\": {}\n};\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (copyDE);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./copy/de.js\n");

